import "./home.css";
import { useNavigate } from "react-router-dom";
function home() {
    const navigate=useNavigate();
    function returnmineHandler(){
        navigate("/mine/")
    }
    return (
    <div className="home-bg">
        <div id="homehead">
            We重邮
        </div>
        <div id="tabbar">
                <div id="timetab">
                    <img src={require("../mine/minepic/timetable.png")} id="timepic" className="tabpic" />
                    <p className="tabp">课表</p>
                </div>
                <div id="home"><img src={require("./homepic/home.jpg")} id="homepic" className="tabpic" />                
                    <p className="tabp" id="hometab">首页</p>
                </div>
                <div id="mine">
                    <button id="minebtn" onClick={returnmineHandler}><img src={require("./homepic/mine.jpg")} id="minepic" className="tabpic" /></button>
                    <p className="tabp" >我的</p>
                </div>
            </div>
        </div>
    );
}
export default home;
